import React, {Component} from 'react';

class Item extends Component {

  render() {
    return  this.props.inventory.map((item)=>(
      <tr>
      <th scope="row"> { this.props.inventory.id }</th>
      <td>{ this.props.inventory.vendor }</td>
      <td>{ this.props.inventory.date_received }</td>
      <td>{ this.props.inventory.PO }</td>
      <td>{ this.props.inventory.material }</td>
      <td>{ this.props.inventory.quantity }</td>
    </tr>
      
    ));
  }
}
export default Item;
